What is the best way to design MongoDB Schema for location based service<p>I am looking for a right database that supports location based search, found MongoDB supports GeoJSON Objects.</p>

<p>This is a Store Locator application, where user can look around and choose Store that's near to him for ordering products.</p>

<p><strong>Simple Vendor schema :</strong></p>

<pre><code>const VendorSchema = new Schema({
    address: {
        type: String,
        required: [true, 'Please add address']
    },
    formattedAddress: {
        type: String
    },
    location: {
        type: {
          type: String,
          enum: ['Point']
        },
        // GeoJSON Points
        coordinates: {
          type: [Number],
          index: '2dsphere'
        },
        formattedAddress: String,
        street: String,
        city: String,
        state: String,
        zipcode: String,
        country: String
    },
    createdAt: {
        type: Date,
        default: Date.now
    }
});
</code></pre>

<p>Database will have many FMCG Products that multiple Vendors could be selling.</p>

<p><strong>Product Schema :</strong></p>

<pre><code>const ProductSchema = new Schema({
    name: {
        type: String,
        required: true
    },
    desc: {
        type: String,
        required: true
    },
    price: Number,
    createdAt: {
      type: Date,
      default: Date.now
    }
});
</code></pre>

<blockquote>
  <p>A Vendor can sell multiple Products and a Product could be sold by many Vendors, there's <code>N-to-N</code> relationship between Vendors &amp; Products.</p>
</blockquote>

<p>So was thinking of creating a new Schema, <strong>VendorProduct Schema :</strong></p>

<pre><code>const VendorProductSchema = new Schema({
    price: Number,
    discountVal: Number,
    vendor : { 
        type: ObjectId, 
        ref: 'Vendor' 
    },
    createdAt: {
      type: Date,
      default: Date.now
    }
});
</code></pre>

<p><strong>This is where its getting tricky / challenging :</strong></p>

<blockquote>
  <p>User's can either look-up for <strong>Vendor/Stores</strong> around them or can also directly search for a <strong>Product</strong>. </p>
</blockquote>

<p>If asked to find Vendors, its straight look up in the Vendors collection with-in certain Radius.</p>

<pre><code>Vendor.find({"location.coordinates": {$geoWithin: {$centerSphere: [[User long, User lat], 1/6378.15]}}})
</code></pre>

<p>But when user searches for a Product :</p>

<p>System should send back searched Product(s) details along with near by Vendors who are selling them - from closest to farthest, in certain radius.</p>

<p>For this reason i was thinking of storing Vendor's GeoJSON location details for a Product in VendorProduct schema.</p>

<p><strong>VendorProduct Schema with GeoJSON details :</strong></p>

<pre><code>const VendorProductSchema = new Schema({
    price: Number,
    discountVal: Number,
    vendor : { 
        type: ObjectId, 
        ref: 'Vendor' 
    },
    location: {
        type: {
          type: String,
          enum: ['Point']
        },
        // GeoJSON Points
        coordinates: {
          type: [Number],
          index: '2dsphere'
        }
    },
    createdAt: {
      type: Date,
      default: Date.now
    }
});
</code></pre>

<p>Let's say user searches with keyword ONIONS. It will be found in Products collection, will use ProductID and in-turn filter them in VendorProducts collection based on Geo co-ordinates. In that way i can pull Product info like description, images from Products collection &amp; Vendor, Prices info from VendorProducts collection.</p>

<p>This is only keeping in mind, a single Product can be sold by multiple Vendors. When user searches with a Product name - there could be N number of sellers of this product at different prices. But to find only closest vendors, was thinking of storing Vendor location details against Product in VendorProductSchema.</p>

<p><strong>FEW QUESTIONS :</strong></p>

<ol>
<li>Is it right to use MongoDB for such use-case ?</li>
<li>Is this the right design and approach ?</li>
<li>What is the time complexity of such Geo location searches in MongoDB ?</li>
</ol>

